import React from 'react';
import { Route, Redirect } from 'react-router-dom';

export const PrivateRoute = ({ component: Component, authorized: authorized, session: session, resetSession: resetSession, ...rest }) => (
    
    <Route {...rest} path="/" render={props => (
        
        authorized
            ? <Component {...props} session={session}/>
            : <Redirect to={{ pathname: '/login' }} />
    )} />
    
)
